            initialValues: {
              email: '',
              password: ''
        
            },
        
            onSubmit: values => {
                console.log(values)
                // alert(JSON.stringify(values, null, 2));
        
            },
        
        });

        // const { email, password } = this.state

        return (
            <Container style={{ padding: '0 10vw' }}>
                <Form onSubmit={formik.handleSubmit}>
                    <Form.Row>
                        <Form.Group as={Col} controlId="formGridEmail">
                            <Form.Label>Email</Form.Label>
                            <Form.Control value={ formik.values.email } onChange={formik.handleChange} type="email" placeholder="Enter email" />
                        </Form.Group>
                    </Form.Row>
                    <Form.Row>
                        <Form.Group as={Col} controlId="formGridPassword">
                            <Form.Label>Password</Form.Label>
                            <Form.Control value={ formik.values.password } onChange={formik.handleChange} type="password" placeholder="Password" />
                        </Form.Group>
                    </Form.Row>
                    {/* <Form.Row>
                        <Form.Group as={Col} controlId="formGridPassword">
